import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be available
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Locate all elements with the class 'product-price'
    const priceLocator = page.locator('.product-price');

    // Ensure at least one price element is visible before proceeding
    await priceLocator.first().waitFor({ state: 'visible', timeout: 5000 });

    // Extract the text content from all price elements
    const priceTexts = await priceLocator.allTextContents();

    // Process the raw text to extract clean numerical prices
    const extractedPrices = priceTexts.map(text => {
      // The text might contain the original price, e.g., "$1199.99 $1299.99"
      // We only want the current price, which is the first part.
      const currentPriceText = text.trim().split(' ')[0];
      // Remove the dollar sign and convert to a number
      return parseFloat(currentPriceText.replace('$', ''));
    }).filter(price => !isNaN(price)); // Filter out any potential NaN values

    // Take a screenshot showing the located elements (though they won't be highlighted)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Successfully extracted all product prices from the page.",
      extractedData: {
        prices: extractedPrices,
        count: extractedPrices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
